import React, { useState } from "react";
import { render } from "react-dom";
import Timeline from "react-visjs-timeline";
import moment from "moment";
import "./styles.css";






const options = {

  width: "100%",
  height: "90vh",
  showMajorLabels: true,
  showCurrentTime: true,
  zoomMin: 1000000,
  type: "ran ge",
  orientation: "top",
  stack: true,
  editable: true,

};

const groups = [
  {
    // className: "box",
    id: 1,
    content: "AUDI",
    items: ["The Audi"],  



  },

  {
    id: 2,
    content: "BMW",
    items: ["Interviews"],
  },

  {
    id: 3,
    content: "APPLE",
    items: [" Roadmap"],
  },
];

const items = [];
groups.forEach((group) => {
  group.items.forEach((item) => {
    items.push({
      id: items.length,
      start: moment().startOf("day").add(items.length, "days"),
      end: moment()
        .startOf("day")
        .add(items.length + 5, "days"), // end is optional
      content: item,
      group: group.id,
    });
  });
});
